/**
  * @brief  Startup : Shows ST logo and slogan
  * @param  None
  * @retval None
  */
void k_StartUp(void)
{
  uint32_t XPos = 45, XOffset = 0;
  const char ST_Slogan[] = "www.beyondcore.net";
  const char *p = ST_Slogan;

  GUI_SetBkColor(GUI_WHITE);
  GUI_Clear();
  GUI_DrawBitmap(&bmlogo_, (LCD_GetXSize() - (bmlogo_.XSize))/2 , (LCD_GetYSize() - (bmlogo_.YSize))/2);

  
  GUI_SetFont(GUI_FONT_13HB_1);
  GUI_SetColor(GUI_BLUE);
  
  do{
    GUI_DispCharAt(*p, XPos , 300);
    XPos += GUI_GetCharDistX(*p++) + XOffset;
    if(*p == '.')
    {
  //    GUI_SetColor(GUI_STCOLOR_DARKBLUE    );
      XOffset = 0;
    }
    GUI_Delay(20);
  }while (*p != 0);

  GUI_Delay(1000);     
}


